import React, { useState } from 'react';
import axios from 'axios';

const InformacoesGerais = () => {
  const [nomeCliente, setNomeCliente] = useState('');
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [visibleClientes, setVisibleClientes] = useState({});

  const pesquisarCliente = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`http://localhost:3333/findClienteByName?name=`);
      setData(response.data);
      console.log(response.data);
      setError(null);
    } catch (error) {
      setError(error);
      setData(null);
    } finally {
      setLoading(false);
    }
  };

  const handleInputChange = (event) => {
    setNomeCliente(event.target.value);
  };


  return (
    <div>
      <label>
        <span>Informe o nome do cliente: </span>
        <input value={nomeCliente} onChange={handleInputChange} name="myInput" />
      </label>
      <button onClick={pesquisarCliente}>
        Pesquisar
      </button>
      {loading && <p>Loading...</p>}
      {error && <p>Error: {error.message}</p>}
      {data && (
        <div >
          <h2>Dados dos Clientes:</h2>
          <p>Total de clientes: {data.length}</p>
          {data.map((cliente) => (
            <div id='clientes' key={cliente.id}>
              <h2 className='nomeCliente'>{cliente.nomeCliente}</h2>
              <button onClick={() => toggleDetails(cliente.id)}>
                {visibleClientes[cliente.id] ? '-' : '+'}
              </button>
              {visibleClientes[cliente.id] && (
                <div id='clientesInformacoes'>
                  <p>Status cliente{cliente.statusCliente}</p>
                  <p>Ip concentrador: {cliente.ipConcentrador}</p>
                  <p>Nome concentrador: {cliente.nomeConcentrador}</p>
                  <p>Latitude do cliente: {cliente.latitudeCliente}</p>
                  <p>Longitude do cliente: {cliente.longitudeCliente}</p>
                  <p>Conexão inicial: {cliente.conexaoInicial}</p>
                  <p>Conexão final: {cliente.conexaoFinal ? cliente.conexaoFinal : 'INDEFINIDO'}</p>
                  <p>Tempo conectado: {cliente.tempoConectado}</p>
                  <p>Consumo de dawnload: {cliente.consumoDownload}</p>
                  <p>Consumo de upload: {cliente.consumoUpload}</p>
                  <p>Motivo da desconexão: {cliente.motivoDesconexao}</p>
                  <p>POP cliente: {cliente.popCliente}</p>
                  <p>Enderço do cliente: {cliente.enderecoCliente}</p>
                  <p>Bairro do cliente: {cliente.bairroCliente}</p>
                  <p>Cidade do cliente: {cliente.cidadeCliente}</p>
                  <p>Plano de contrato: {cliente.planoContrato}</p>
                  <p>Status da internet: {cliente.statusInternet}</p>
                  <p>Valor do plano: {cliente.valorPlano}</p>
                </div>
              )}
            </div>
          ))}
        </div>
        

      )}
    </div>
  );
};

export default InformacoesGerais;
